	<script type="text/javascript">
		var opacity = .3;

		function toggleElements(process) {
			$("v\\:cp[v\\:lbl='" + process + "']").closest('g').hide();
		}

		function decodeValue(value) {
			return value.replace(/VT4\(|\)$/g, '');
		}

		function encodeValue(value) {
			return 'VT4(' + value + ')';
		}

		function getVariable(variableName) {
			return $('g:not([v\\:index="1"]):has(v\\:cp[v\\:lbl="variable"][v\\:val="' + encodeValue(variableName) + '"])');
		}

		function getProcesses(variableName, enabled) {
			// var variableFilter = '[v\\:val' + (filterOutputProcess ? '^="VT4(' : '*=",') + variableName + '"]';
			var variableFilter = '[v\\:val*="' + variableName + '"]';
			var enabledFilter = '';

			if (enabled != undefined) {
				enabledFilter = enabled ? ':not(.disabled)' : '.disabled';
			}

			return $('g:not([v\\:index="1"]):has(v\\:cp[v\\:lbl="process"]' + variableFilter + ')' + enabledFilter);
		}

		function enableVariable(variableName) {
			var variableElement = getVariable(variableName);

			if (!variableElement.hasClass('disabled')) {
				return;
			}

			var processes = getProcesses(variableName);

			variableElement.css('opacity', 1).removeClass('disabled');

			processes.each(function() {
				enableProcess($(this));
			});
		}

		function disableVariable(variableName) {
			var variableElement = getVariable(variableName);

			if (variableElement.find('v\\:cp[v\\:lbl="blocked"]').length == 0) {
				variableElement.css('opacity', opacity).addClass('disabled');
			}

			var processes = getProcesses(variableName);

			processes.each(function() {
				if (!$(this).hasClass('disabled')) {
					disableProcess($(this));
				}
			});
		}

		function enableProcess(process) {
			var variables = decodeValue(process.find('v\\:cp[v\\:lbl="process"]').attr('v:val')).split(',');
			var disabledOutputProcesses = getProcesses(variables[0], false).length;
			var disabledInputProcesses = getProcesses(variables[1], false).length;

			process.css('opacity', 1).removeClass('disabled');

			enableVariable(variables[0]);
			enableVariable(variables[1]);
		}

		function disableProcess(process) {
			process.css('opacity', opacity).addClass('disabled');

			var variables = decodeValue(process.find('v\\:cp[v\\:lbl="process"]').attr('v:val')).split(',');
			var fromHasProcessesEnabled = getProcesses(variables[0], true).length > 0;
			var toHasProcessesEnabled = getProcesses(variables[1], true).length > 0;

			if (!fromHasProcessesEnabled) {
				disableVariable(variables[0]);
			}

			if (!toHasProcessesEnabled) {
				disableVariable(variables[1]);
			}
		}

		$(document).ready(function() {
			var processWrapper = $("v\\:cp[v\\:lbl='process']").closest('g');

			processWrapper.css('cursor', 'pointer').hover(function() {
				$(this).css('text-decoration', 'underline');
			}, function() {
				$(this).css('text-decoration', 'none');
			});

			processWrapper.on('click', function() {
				if ($(this).hasClass('disabled')) {
					enableProcess($(this));
				} else {
					disableProcess($(this));
				}
			});

			var staticVariables = $('g:has(v\\:cp[v\\:lbl="blocked"])');
			staticVariables.css('cursor', 'default');

			var variables = $('g:has(v\\:cp[v\\:lbl="variable"])').not(staticVariables);
			variables.css('cursor', 'pointer');
			variables.on('click', function() {
				var variableName = decodeValue($(this).find('v\\:cp[v\\:lbl="variable"]').attr('v:val'));

				if ($(this).hasClass('disabled')) {
					enableVariable(variableName);
				} else {
					disableVariable(variableName);
				}
			});
		});
	</script>
